function Buttons(props) {
    return (
        <div>
            <button className="btn-danger" onClick={() => { props.chenge(props.data + 1) }}>{props.name}++</button>
            <button onClick={() => { props.chenge(props.data - 1) }}>{props.name}--</button>
        </div>
    )
}
export default Buttons
